import React from 'react';
import { Link } from 'react-router-dom';

const RegistrationPage = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    // You can use a state management library or handle the form data in this component
    // For simplicity, you can log the form data to the console for now
    const formData = new FormData(e.target);
    const data = {};
    formData.forEach((value, key) => {
      data[key] = value;
    });
    console.log(data);
  };

  return (
    <div className="container mt-5">
      <h1 className="mb-3">Registracija novog korisnika</h1>

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="name" className="form-label">Unesite ime:</label>
          <input type="text" required className="form-control" name="name" />
        </div>
        {/* Repeat similar structures for other form fields */}

        <div>
          <button type="submit" className="btn btn-primary">
            <i className="bi bi-plus-circle-dotted"></i> Registruj se
          </button>
          <button type="reset" className="btn btn-outline-secondary">Obrisi podatke</button>
        </div>
      </form>

      <div className="mt-3">
        <Link to="/">Back to Home</Link>
      </div>
    </div>
  );
};

export default RegistrationPage;
